import logo from './logo.svg';
import './App.css';

const data =[]
function Button (){
  return(
    <button className="button">click Me</button>
  )
}

function Header(){
  return(
    <header className ="App-header">
    <img src="" alt="Logo"/>
    <nav>
    <ul>
    <li><a href="#"> Home</a></li>
    <Button/>
    </ul>
    </nav>
    </header>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
      <Button/>
      <h1>Bienvenidos </h1>
    </div>
  );
}

export default App;
